import React, { useState } from 'react';
import axios from 'axios';

const backendURL = 'http://your-backend-api-url'; // Replace with your actual backend API URL

function ProductForm() {
  const [productName, setProductName] = useState('');
  const [productImageURL, setProductImageURL] = useState('');
  const [productPrice, setProductPrice] = useState('');
  const [productDescription, setProductDescription] = useState('');

  const handleProductNameChange = (e) => {
    setProductName(e.target.value);
  };

  const handleProductImageURLChange = (e) => {
    setProductImageURL(e.target.value);
  };

  const handleProductPriceChange = (e) => {
    setProductPrice(e.target.value);
  };

  const handleProductDescriptionChange = (e) => {
    setProductDescription(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const productData = {
      name: productName,
      imageURL: productImageURL,
      price: productPrice,
      description: productDescription,
    };

    axios.post(`${backendURL}/products`, productData)
      .then((response) => {
        // Handle successful response from the backend
        console.log(response.data); // Assuming the backend returns the created product details
        // Reset the form fields
        setProductName('');
        setProductImageURL('');
        setProductPrice('');
        setProductDescription('');
      })
      .catch((error) => {
        // Handle error from the backend
        console.error(error);
      });
  };

  const handleAddToCart = (e) => {
    e.preventDefault();
    // Handle adding the product to the cart
    // You can implement this logic based on your application requirements
    // For example, you could maintain a cart state and add the selected product to the cart array
  };

  return (
    <main className="form-product">
      <form id="product-form" onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="productNameInput" className="form-label">
            Name
          </label>
          <input
            type="text"
            className="form-control"
            id="productNameInput"
            placeholder="Product Name"
            value={productName}
            onChange={handleProductNameChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="productImageURLInput" className="form-label">
            Image URL
          </label>
          <input
            type="url"
            className="form-control"
            id="productImageURLInput"
            placeholder="Product Image URL"
            value={productImageURL}
            onChange={handleProductImageURLChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="productPriceInput" className="form-label">
            Price
          </label>
          <input
            type="number"
            className="form-control"
            id="productPriceInput"
            placeholder="Product Price"
            value={productPrice}
            onChange={handleProductPriceChange}
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="productDescriptionInput" className="form-label">
            Description
          </label>
          <input
            type="text"
            className="form-control"
            id="productDescriptionInput"
            placeholder="Product Description"
            value={productDescription}
            onChange={handleProductDescriptionChange}
            required
          />
        </div>
        <button type="submit" className="btn btn-warning">
          Submit
        </button>
      </form>

      <div className="product-details">
        <h2>Product Details</h2>
        <p>Name: {productName}</p>
        <p>Image URL: {productImageURL}</p>
        <p>Price: {productPrice}</p>
        <p>Description: {productDescription}</p>
        <button onClick={handleAddToCart} className="btn btn-primary">
          Add to Cart
        </button>
      </div>
    </main>
  );
}

export default ProductForm;
